#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <conio.h>

struct node
{
    int id, fees, enrolled;
    float rating;
    char name[50], field[50];
    struct node *next;
};

struct nodeS
{
    int std_id;
    int course_id;
    char namec[50], fieldc[50];
    struct nodeS *nextS;
};

struct node *headWeb, *headSware, *headApp, *headAi;
struct node *one, *two, *three, *four, *hundred;
struct nodeS *headStud = NULL; // No List is formed Yet

char webDev[50] = "Web Development", softWare[50] = "Software Development";
char appDev[50] = "Android App Development", machineAi[50] = "Machine Learning and AI";

int course_id = 0;
int stud_id = 10000;

char studName[50];
int studPass, studAccStatus = 1; // 0 = Already Created 1 = Not Creted
int managerPass = 1234;

// Function just to print complete data from nodes - showData
void showData(struct node *trav);

// Main Nodes of all the data of course
void maindata();

// Funcion for Student's access - student
void student();

// Funcion for Manager's access - manager
void manager();

// Function to add a new course by manager - addCourse
void addCourse();

// Traversal
struct node *traversal(struct node *trav)
{
    if (trav == NULL)
    {
        printf("\nNo Courses Found");
    }
    else
    {
        printf("\n\n{Displaying %s Courses}", trav->field);
        while (trav->next != NULL)
        {
            showData(trav);
            trav = trav->next;
        }
        showData(trav);
        printf("\n ");
    }
}

// Function to assign a id number to each node - idAssign
struct node *idAssign(struct node *trav);

// Function to delete the course by manager - delCourse
struct node *delCourse();

// Function to search for a course - search
struct node *search();

// Function to update a course - update
struct node *update();

// Function for Student for purchasing the course
void course_purchase();

// Funtion to remove addmission of a student by the manager - remove_admission
void remove_addmision();

// Stundents' Traversal - traversalStud
void traversalStud();

// Function for student's unenrollment - unenroll
struct node *unenroll();

// Function to Remove a course from student after deletion - delStudCourse
struct nodeS *delStudCourse(int delId);

///////////////// MAIN FUNCTION
