// Funcion for Student's access - student
void student()
{
    int choice;

studentAcc:
    while (1)
    {
        printf("\n1) --> Display Available Courses\n2) --> Display your Admissions\n3) --> Join a Course\n4) --> Search a Course by Category\n5) --> Unenroll from a Course\n6) --> Sign-out\n");
        printf("\nEnter Choice: ");
        scanf("%d", &choice);
        switch (choice)
        {
        case 1:
        {
            printf("\nDisplaying ALL Available Courses!");
            traversal(headWeb);
