void manager()
{
    int choice;
managerAcc:
    while (1)
    {
        printf("\n1) --> Display All Courses\n2) --> Add new Course\n3) --> Delete a Course\n4) --> Search a Course by Category\n5) --> Update a Course\n6) --> Student Information\n7) --> Remove a Student from a Course\n8) --> Sign-out\n");
        printf("\nEnter Choice : ");
        scanf("%d", &choice);
        switch (choice)
        {
        case 1:
        {
            traversal(headWeb);
            traversal(headSware);
            traversal(headApp);
            traversal(headAi);
