        case 2:
        {
            addCourse();
            break;
        }
        case 3:
        {
            delCourse();
            break;
        }
        case 4:
        {
            search();
            break;
        }
        case 5:
        {
            update();
            break;
        }
        case 6:
        {
            traversalStud();
            break;
        }
        case 7:
        {
            remove_addmision();
            break;
        }
        case 8:
        {
            goto cancel;
        }
