// Function just to print complete data from nodes - showData
void showData(struct node *trav)
{
    printf("\n\n%d)--> %s", trav->id, trav->name);
    printf("\n\tCourse Field: %s", trav->field);
    printf("\n\tCourse Fees: %d Rs.", trav->fees);
    printf("\n\tEntrolled Students: %d", trav->enrolled);
    printf("\n\tRatings: %0.1f/5 Stars", trav->rating, trav->fees);
    trav = trav->next;
}

// Function to assign a id number to each node - idAssign
struct node *idAssign(struct node *trav)
{
    while (trav != NULL)
    {
        trav->id = ++course_id;
        trav = trav->next;
    }
}

// Function to add a new course by manager - addCourse
void addCourse()
{
    struct node *start, *trav;
    struct node *newnode = (struct node *)malloc(sizeof(struct node));
    int choice;
    printf("\n\n1) --> Web Development\n2) --> Software Development\n3) --> Android App Development\n4) --> Machine Learning and AI\n");
    printf("\nEnter new Course in: ");
    scanf("%d", &choice);
    switch (choice)
    {
    case 1:
        start = headWeb;
        break;
    case 2:
        start = headSware;
        break;
    case 3:
        start = headApp;
        break;
    case 4:
        start = headAi;
        break;
    default:
        break;
    }

    strcpy(newnode->field, start->field);
    printf("\nEnter %s Course's Details: ", newnode->field);
    newnode->id = ++course_id;
    printf("\nID = %d", newnode->id);
    printf("\nEnter Course Name: ");
    fflush(stdin);
    gets(newnode->name);
    printf("Enter fees: ");
    scanf("%d", &newnode->fees);
    printf("Enter enrolled: ");
    scanf("%d", &newnode->enrolled);
    printf("Enter ratings: ");
    scanf("%f", &newnode->rating);

    trav = start;
    while (trav->next != NULL)
    {
        trav = trav->next;
    }
    trav->next = newnode;
    newnode->next = NULL;
    traversal(start);
}

// Function to delete the course by manager - delCourse
struct node *delCourse()
{
    struct node *start, *temp, *p, *deleted;
    int choice;
    printf("\nNOTE: This will delete the Same Course from Students' Account.");
    printf("\n\n1) --> Web Development\n2) --> Software Development\n3) --> Android App Development\n4) --> Machine Learning and AI\n");
    printf("\nDelete a course from: ");
    scanf("%d", &choice);
    int delId;
    switch (choice)
    {
    case 1:
        traversal(headWeb);
        printf("\n\nEnter %s Course Number for deletion: ", headWeb->field);
        scanf("%d", &delId);
        if (headWeb->id == delId)
        {
            temp = headWeb;
            if (headWeb->next == NULL)
            {
                headWeb = NULL;
            }
            else
            {
                headWeb = headWeb->next;
            }
            free(temp);
            delStudCourse(delId);
        }
        start = headWeb;
        break;
    case 2:
        traversal(headSware);
        printf("\n\nEnter %s Course Number for deletion: ", headSware->field);
        scanf("%d", &delId);
        if (headSware->id == delId)
        {
            temp = headSware;
            if (headSware->next == NULL)
            {
                headSware = NULL;
            }
            else
            {
                headSware = headSware->next;
            }
            free(temp);
            delStudCourse(delId);
        }
        start = headSware;
        break;
    case 3:
        traversal(headApp);
        printf("\n\nEnter %s Course Number for deletion: ", headApp->field);
        scanf("%d", &delId);
        if (headApp->id == delId)
        {
            temp = headApp;
            if (headApp->next == NULL)
            {
                headApp = NULL;
            }
            else
            {
                headApp = headApp->next;
            }
            free(temp);
            delStudCourse(delId);
        }
        start = headApp;
        break;
    case 4:
        traversal(headAi);
        printf("\n\nEnter %s Course Number for deletion: ", headAi->field);
        scanf("%d", &delId);
        if (headAi->id == delId)
        {
            temp = headAi;
            if (headAi->next == NULL)
            {
                headAi = NULL;
            }
            else
            {
                headAi = headAi->next;
            }
            free(temp);
            delStudCourse(delId);
        }
        start = headAi;
        break;
    default:
        printf("\nInvalid Choice");
        break;
    }

    if (start != NULL && start->id != delId)
    {
        p = start;
        if (start->next == NULL)
        {
            temp = start;
        }
        else
        {
            temp = start->next;
        }

        while (temp->id != delId && temp->next != NULL)
        {
            temp = temp->next;
            p = p->next;
        }
        if (temp->id == delId && temp->next != NULL)
        {
            p->next = temp->next;
            free(temp);
            delStudCourse(delId);
            printf("\nThe Course with ID %d was deleted.", delId);
        }
        else if (temp->id == delId && temp->next == NULL)
        {
            p->next = NULL;
            free(temp);
            delStudCourse(delId);
            printf("\nThe Course with ID %d was deleted.", delId);
        }
        else
        {
            printf("\nCOURSE NOT FOUND");
        }
        traversal(start);
    }
}

// Function to Remove a course from student after deletion - delStudCourse
struct nodeS *delStudCourse(int delId)
{
    struct nodeS *q, *temp;
    temp = headStud;

    if (headStud->course_id == delId)
    {
        if (headStud->nextS == NULL)
        {
            headStud = NULL;
        }
        else
        {
            headStud = headStud->nextS;
        }
        printf("\nYou are Unenrolled from %s\n", temp->namec);
        free(temp);
    }
    else
    {
        q = headStud;
        if (headStud->nextS == NULL)
        {
            temp = headStud;
        }
        else
        {
            temp = headStud->nextS;
        }

        while (temp->std_id != delId && temp->nextS != NULL)
        {
            temp = temp->nextS;
            q = q->nextS;
        }
        if (temp->std_id == delId && temp->nextS != NULL)
        {
            q->nextS = temp->nextS;
            free(temp);
        }
        else if (temp->std_id == delId && temp->nextS == NULL)
        {
            q->nextS = NULL;
            free(temp);
        }
    }
}

// Function to search for a course - search
struct node *search()
{
    int choice, searchId;
    struct node *trav;
    printf("\n\n1) --> Web Development\n2) --> Software Development\n3) --> Android App Development\n4) --> Machine Learning and AI\n");
    printf("\nSearch a Course in: ");
    scanf("%d", &choice);
    switch (choice)
    {
    case 1:
        trav = headWeb;
        break;
    case 2:
        trav = headSware;
        break;
    case 3:
        trav = headApp;
        break;
    case 4:
        trav = headAi;
        break;
    default:
        break;
    }

    if (trav == NULL)
    {
        printf("\nNo Courses Available.");
    }
    else
    {
        printf("\n~Enter Course ID for Display: ");
        scanf("%d", &searchId);

        while (trav->next != NULL)
        {
            trav = trav->next;
        }
        if (trav->id == searchId)
        {
            showData(trav);
        }
        else
        {
            printf("\nCourse With ID %d NOT Found.", searchId);
        }
    }
}

// Function to update a course - update
struct node *update()
{
    int choice, updateId;
    struct node *trav;
    printf("\n\n1) --> Web Development\n2) --> Software Development\n3) --> Android App Development\n4) --> Machine Learning and AI\n");
    printf("\nUpdate a Code from: ");
    scanf("%d", &choice);
    switch (choice)
    {
    case 1:
        trav = headWeb;
        break;
    case 2:
        trav = headSware;
        break;
    case 3:
        trav = headApp;
        break;
    case 4:
        trav = headAi;
        break;
    default:
        break;
    }

    traversal(trav);
    printf("\n\nEnter Course ID for Updation: ");
    scanf("%d", &updateId);

    while (trav->id != updateId && trav->next != NULL)
    {
        trav = trav->next;
    }
    if (trav->id == updateId)
    {
        showData(trav);
        printf("\nEnter %d Course's Updated Details: ", trav->id);
        printf("\nEnter Course Name: ");
        fflush(stdin);
        gets(trav->name);
        printf("Enter fees: ");
        scanf("%d", &trav->fees);
        printf("Enter enrolled: ");
        scanf("%d", &trav->enrolled);
        printf("Enter ratings: ");
        scanf("%f", &trav->rating);
        printf("\nCourse Updated!\n");
        showData(trav);
    }
    else
    {
        printf("\nNo Such Course Found");
    }
}

// Funtion to remove addmission of a student by the manager - remove_admission
void remove_addmision()
{
    if (headStud == NULL)
    {
        printf("\nNo Students are Enrolled");
    }
    else
    {
        int val, stu_id;
        struct nodeS *q, *temp;

        printf("\nEnter a Course ID : ");
        scanf("%d", &val);
        printf("\nEnter a Student ID : ");
        scanf("%d", &stu_id);

        traversalStud();
        if (headStud->course_id == val && headStud->std_id == stu_id)
        {
            temp = headStud;
            headStud = headStud->nextS;
            free(temp);
            return;
        }
        else
        {
            q = headStud;
            if (headStud->nextS == NULL)
            {
                temp = headStud;
            }
            else
            {
                temp = headStud->nextS;
            }

            while (temp->std_id != stud_id && temp->course_id != val && temp->nextS != NULL)
            {
                temp = temp->nextS;
                q = q->nextS;
            }
            if (temp->std_id == stud_id && temp->course_id == val && temp->nextS != NULL)
            {
                q->nextS = temp->nextS;
                free(temp);
            }
            else if (temp->std_id == stud_id && temp->course_id == val && temp->nextS == NULL)
            {
                q->nextS = NULL;
                free(temp);
            }
        }

        printf("\nStudent Removed Successfully.");
    }

    traversalStud();
}

//////////////////////// Students Functions /////////////////////////////

// Function for Student for purchasing the course - course_purchase
void course_purchase()
{
    struct nodeS *temp1, *q;
    struct node *start;
    temp1 = (struct nodeS *)malloc(sizeof(struct nodeS));

    int choice;
    printf("\n\n1) --> Web Development\n2) --> Software Development\n3) --> Android App Development\n4) --> Machine Learning and AI\n");
    printf("\nEnter a choice : ");
    scanf("%d", &choice);
    switch (choice)
    {
    case 1:
    {
        start = headWeb;
        break;
    }
    case 2:
    {
        start = headApp;
        break;
    }
    case 3:
    {
        start = headAi;
        break;
    }
    case 4:
    {
        start = headSware;
        break;
    }
    default:
        printf("\nInvaid choice\n");
        break;
    }

    traversal(start);
    printf("Enter the Course ID for Purchase: ");
    scanf("%d", &temp1->course_id);

    temp1->nextS = NULL;
    temp1->std_id = ++stud_id;

    struct node *temp = start;
    while (temp != NULL)
    {
        if (temp1->course_id == temp->id)
        {
            strcpy(temp1->namec, temp->name);
            strcpy(temp1->fieldc, temp->field);
            temp->enrolled = ++temp->enrolled;
        }
        temp = temp->next;
    }

    if (headStud == NULL)
    {
        headStud = temp1;
        headStud->nextS = NULL;
        printf("\nYou are admitted to %s", headStud->namec);
    }
    else
    {
        q = headStud;
        while (q->nextS != NULL)
        {
            q = q->nextS;
        }
        q->nextS = temp1;
        temp1->nextS = NULL;
        printf("\nYou are admitted to %s", temp1->namec);
    }
    traversalStud();
}

// Stundents' Traversal - traversalStud
void traversalStud()
{
    struct nodeS *temp;
    if (headStud == NULL)
    {
        printf("\nNo Students are Enrolled");
    }
    else
    {
        temp = headStud;
        printf("\n---Displaying %s courses", studName);
        printf("\n---Student ID     : %d\n", temp->std_id);
        while (temp != NULL)
        {
            printf("\nCourse ID      : %d", temp->course_id);
            printf("\nCourse Name    : %s", temp->namec);
            printf("\nCourse Field   : %s\n\n", temp->fieldc);
            temp = temp->nextS;
        }
    }
}

// Function for student's unenrollment - unenroll
struct node *unenroll()
{
    traversalStud();

    printf("\nUnenroll from a course.\n");
    int unenroll_id;
    printf("\nEnter the Course ID for Unenrolling: ");
    scanf("%d", &unenroll_id);

    struct nodeS *q, *temp;
    struct node *de_enroll;
    temp = headStud;

    // For Decrementing the Enrolled Student's Number
    if (!strcmp(temp->fieldc, webDev))
    {
        de_enroll = headWeb;
    }
    else if (!strcmp(temp->fieldc, softWare))
    {
        de_enroll = headSware;
    }
    else if (!strcmp(temp->fieldc, appDev))
    {
        de_enroll = headApp;
    }
    else if (!strcmp(temp->fieldc, machineAi))
    {
        de_enroll = headAi;
    }

    while (de_enroll->id != unenroll_id && de_enroll->next != NULL)
    {
        de_enroll = de_enroll->next;
    }
    if (de_enroll->id == unenroll_id)
    {
        de_enroll->enrolled = --de_enroll->enrolled;
    }

    if (headStud->course_id == unenroll_id)
    {
        if (headStud->nextS == NULL)
        {
            headStud = NULL;
        }
        else
        {
            headStud = headStud->nextS;
        }
        printf("\nYou are Unenrolled from %s\n", temp->namec);
        free(temp);
    }
    else
    {
        q = headStud;
        if (headStud->nextS == NULL)
        {
            temp = headStud;
        }
        else
        {
            temp = headStud->nextS;
        }

        while (temp->std_id != unenroll_id && temp->nextS != NULL)
        {
            temp = temp->nextS;
            q = q->nextS;
        }
        if (temp->std_id == unenroll_id && temp->nextS != NULL)
        {
            q->nextS = temp->nextS;
            free(temp);
        }
        else if (temp->std_id == unenroll_id && temp->nextS == NULL)
        {
            q->nextS = NULL;
            free(temp);
        }
        else
        {
            printf("\nThe Course with ID %d not Found", unenroll_id);
        }
    }
    traversalStud();
}

