const map<string, double>& SearchServer::GetWordFrequencies(int document_id) const {  
    static const std::map<std::string, double> dummy;  

    if (document_to_word_freqs_.find(document_id) != document_to_word_freqs_.end()) {  
        return document_to_word_freqs_.at(document_id);  
    }  
    return dummy;  
}  

void SearchServer::RemoveDocument(int document_id)  
{  
    if (documents_.count(document_id) <= 0) return; 
        documents_.erase(document_id);  
        for (auto& word_freqs : word_to_document_freqs_)  
        {  
            word_freqs.second.erase(document_id);  
        }  

        document_to_word_freqs_.erase(document_id);  
        document_ids_.erase(std::remove(document_ids_.begin(), document_ids_.end(), document_id), document_ids_.end());  
}  

void SearchServer::RemoveDocument(std::execution::sequenced_policy policy, int document_id){
    RemoveDocument(document_id);
}
    void SearchServer::RemoveDocument(std::execution::parallel_policy policy, int document_id){
        
        vector<const string*> temp;
        transform(policy, word_to_document_freqs_.begin(), word_to_document_freqs_.end(), temp.begin(),
                 [document_id](const auto& element){
                     if(element.second.first == document_id){
                         return element.first;
                     }
                 });
        document_to_word_freqs_.erase(document_id);  
        document_ids_.erase(std::remove(document_ids_.begin(), document_ids_.end(), document_id), document_ids_.end()); 
  
    }

SearchServer::SearchServer(const std::string& stop_words_text)  
    : SearchServer(SplitIntoWords(stop_words_text)) // Invoke delegating constructor from string container  
{  
}  

void SearchServer::AddDocument(int document_id, const string& document, DocumentStatus status, const vector<int>& ratings)  
{  
    if ((document_id < 0) || (documents_.count(document_id) > 0))  
    {  
        throw invalid_argument("Invalid document_id"s);  
    }  
    const auto words = SplitIntoWordsNoStop(document);  
    const double inv_word_count = 1.0 / words.size();  
    for (const string& word : words)  
    {  
        word_to_document_freqs_[word][document_id] += inv_word_count;  
        document_to_word_freqs_[document_id][word] += inv_word_count;  
    }  
    documents_.emplace(document_id, DocumentData{ ComputeAverageRating(ratings), status});  
    document_ids_.push_back(document_id);  
}  

