import {createSlice} from '@reduxjs/toolkit'
import { registerAuth } from '../action'
import { loginAuth } from '../action'

const token = localStorage.getItem('token') ? localStorage.getItem('token') : null

const initialState = {
    loading: false,
    userInfo: null,
    token,
    error: null,
    success: false
}

const authSlice = createSlice({
    name: 'auth',
    initialState,
    reducers: {
        setCredentials: (state, {payload}) => {
            state.userInfo = payload
        }
    },
    extraReducers: (builder) => {
        builder.addCase(loginAuth.pending, (state) => {
            state.loading = true
            state.error = false
        })
        .addCase(loginAuth.fulfilled, (state, {payload}) => {
            state.loading = false
            state.userInfo = payload
            state.userToken = payload.userToken
        })
        .addCase(loginAuth.rejected, (state, {payload}) => {
            state.loading = false
            state.error = payload
        })

        .addCase(registerAuth.pending, (state) => {
            state.loading = true
            state.error = false
        })
        .addCase(registerAuth.fulfilled, (state, {payload}) => {
            state.loading = false
            state.success = true
        })
        .addCase(registerAuth.rejected, (state, {payload}) => {
            state.loading = false
            state.error = payload
        })
    }
})

export const {setCredentials} = authSlice.actions
export default authSlice.reducer

