export const registerAuth = createAsyncThunk('auth/register', async({first_name, last_name, email, password}, {rejectWithValue}) => {
    try {
        const config = {
            headers: {
                'Content-Type': 'application/json',
            }
        }
        const data = await dataTopUp.post('/registration', {first_name, last_name, email, password}, config)
        return data
    } catch (error) {
        if(error.respone && error.respone.data.message){
            return rejectWithValue(error.respone.data.message)
        }else{
            return rejectWithValue(error.respone)
        }
    }
})

export const loginAuth = createAsyncThunk('auth/login', async({email, password}, {rejectWithValue}) => {
    try {
        const config = {
            headers: {
                'Content-Type': 'application/json'
            }
        }

        const {data} = await dataTopUp.post('/login', {email, password}, config)
        localStorage.setItem('token', data.token)
        return data
    } catch (error) {
        if(error.respone && error.respone.data.message){
            return rejectWithValue(error.respone.data.message)
        }else{
            return rejectWithValue(error.respone)
        }
    }
})

