-- A ‘local realistic’ simulation of the ‘two-channel Bell test’ of
-- https://en.wikipedia.org/w/index.php?title=CHSH_inequality&oldid=1170465048#Experiments,
-- demonstrating that ‘Bell’s theorem’, which is described in the
-- following reference, is wrong:
--
-- [1] J. S. Bell, ‘Bertlmann’s socks and the nature of reality’,
--     preprint, CERN-TH-2926 (1980).
--     http://cds.cern.ch/record/142461/ (Open access, CC BY 4.0)
--
-- Bell commits the infamous fallacy of assuming that causal
-- independence implies logical independence, and asserts this
-- assumption as an axiom in lieu of Bayes’ rule. Therefore his
-- ‘theorem’ is without foundation. One must never, ever ‘separate a
-- and b’ the way Bell did. But a simulation that contradicts Bell’s
-- conclusion would be an even stronger demonstration that he was
-- wrong.
--
----------------------------------------------------------------------
--
-- The simulation is written in Ada. A free software Ada compiler is
-- widely available: GCC. Many readers can compile this program,
-- optimized and with runtime checks, by saving it in a file called
-- ‘eprb_wikipedia.adb’ and then running the command
--
--   gnatmake -O2 -gnata eprb_coherent
--
-- which will create an executable program called ‘eprb_coherent’.
-- Alternatively, translate the program into the language of your
-- choice.

----------------------------------------------------------------------

pragma ada_2022;
pragma wide_character_encoding (utf8);

with ada.wide_wide_text_io;
with ada.containers;
with ada.containers.doubly_linked_lists;
with ada.numerics;
with ada.numerics.generic_elementary_functions;

----------------------------------------------------------------------

procedure eprb_coherent is

  -- A ‘scalar’ is a double precision floating point number.
  type scalar is digits 15;

  subtype scalar_in_0_1 is scalar range 0.0 .. 1.0;
  subtype correlation_coefficient is scalar range -1.0 .. 1.0;

  knob_max : constant scalar := 11.0;
  subtype knob_type is scalar range 0.0 .. knob_max;

  use ada.wide_wide_text_io;
  use ada.numerics;
  use ada.containers;

  package scalar_elementary_functions is
    new ada.numerics.generic_elementary_functions (scalar);
  use scalar_elementary_functions;

  package scalar_io is new float_io (scalar);
  use scalar_io;

  π     : constant scalar := pi;
  π_2   : constant scalar := π / 2.0;
  π_3   : constant scalar := π / 3.0;
  π_4   : constant scalar := π / 4.0;
  π_6   : constant scalar := π / 6.0;
  π_8   : constant scalar := π / 8.0;
  π_180 : constant scalar := π / 180.0;
  two_π : constant scalar := 2.0 * π;

----------------------------------------------------------------------

  -- For the sake of reproducibility, let us write our own random
  -- number generator. It will be a simple linear congruential
  -- generator. The author has used one like it, in quicksorts and
  -- quickselects to select the pivot. It is good enough for our
  -- purpose.

  type uint64 is mod 2 ** 64;

  -- The multiplier lcg_a comes from Steele, Guy; Vigna, Sebastiano
  -- (28 September 2021). ‘Computationally easy, spectrally good
  -- multipliers for congruential pseudorandom number generators’.
  -- arXiv:2001.05304v3 [cs.DS]

  lcg_a : constant uint64 := 16#F1357AEA2E62A9C5#;

  -- The value of lcg_c is not critical, but should be odd.

  lcg_c : constant uint64 := 1;

  seed  : uint64 := 0;

  --
  -- random_scalar: returns a non-negative scalar less than 1.
  --
  function random_scalar
  return scalar_in_0_1
  with post => random_scalar'result < 1.0 is
    randval : scalar;
  begin
    -- Take the high 48 bits of the seed and divide it by 2**48.
    randval := scalar (seed / (2**16)) / scalar (2**48);

    -- Update the seed.
    seed := (lcg_a * seed) + lcg_c;

    return randval;
  end random_scalar;

----------------------------------------------------------------------

  type vector is 
    record
      e1, e2 : scalar;
    end record;

  -- The basis vectors.
  e1 : constant vector := (e1 => 1.0, e2 => 0.0);
  e2 : constant vector := (e1 => 0.0, e2 => 1.0);

  function "*" (α : scalar; ω : vector)
  return vector is
  begin
    return (e1 => α * ω.e1, e2 => α * ω.e2);
  end "*";

  function "*" (ω : vector; α : scalar)
  return vector is
  begin
    return (e1 => ω.e1 * α, e2 => ω.e2 * α);
  end "*";

  -- The scalar product of two vectors.
  function dot (ω1, ω2 : vector)
  return scalar is
  begin
    return (ω1.e1 * ω2.e1) + (ω1.e2 * ω2.e2);
  end dot;

  -- A counterclockwise rotation by δ radians.
  function rotate (ω : vector;
                   δ : scalar)
  return vector is
  begin
    return (e1 => (ω.e1 * cos (δ)) - (ω.e2 * sin (δ)),
            e2 => (ω.e1 * sin (δ)) + (ω.e2 * cos (δ)));
  end rotate;

----------------------------------------------------------------------

  --
  -- A photon is a sample from a pair of out-of-phase, perpendicularly
  -- plane-polarized, coherent electromagnetic waves. The geometry of
  -- the light source is such that the photon in the R channel is
  -- rotated 90 degrees with respect to the L channel, but this does
  -- not affect its electromagnetic parameters with respect to local
  -- coordinates.
  --
  -- There are also two more plane-polarized waves, in phase with the
  -- others but perpendicular to them.
  --
  -- For our purposes, then, the two photons are equal. They are
  -- perfectly correlated. The question we must answer is whether a
  -- Bell-test apparatus can detect this correlation.
  --
  -- The answer is yes.
  --

  type photon is
    record
      τ : vector;    -- Phase relationship of the perpendicular waves.
    end record;

  function generate_photon
  return photon is
  begin
    return (τ => rotate (e1, two_π * random_scalar));
  end generate_photon;

----------------------------------------------------------------------

  --
  -- Polarizing beam splitters (PBS) behave randomly according to the
  -- Law of Malus. That is, we presume not to know why they ‘choose’
  -- the direction that they do. We do know, however, that they follow
  -- the Law of Malus.
  --
  -- Note that there IS superposition, but it is not the
  -- ‘superposition’ of quantum theory. It is wave interference.
  --
  -- Bell, CHSH, etc., fail to take into account that the photons are
  -- CLASSICALLY COHERENT. They are correlated with each other ALONG
  -- THE TIME AXIS.
  --
  -- They would NOT have failed to take this into account had Bell NOT
  -- mistakenly ‘separated a and b’! Probability theory would have
  -- protected them against their mistake.
  --
  -- The classical coherence of EPR-B photons is an excellent
  -- counterexample to the assumption one can assume statistical
  -- independence from causal independence.
  --

  subtype pbs_setting is vector;

  procedure split_beam (θ        : pbs_setting;
                        φ        : photon;
                        channel1 : out boolean;
                        channel2 : out boolean) is
    ω1, ω2 : vector;       -- Electromagnetic waves.
    α1, α2 : scalar;       -- Field strengths for channel 1.
    α      : scalar;       -- Total field strength after interference.
    β1, β2 : scalar;       -- Field strengths for channel 2.
    β      : scalar;       -- Total field strength after interference.
  begin
    ω1 := φ.τ.e1 * e1;
    ω2 := φ.τ.e2 * e2;

    α1 := dot (θ, ω1);
    α2 := dot (θ, ω2);
    α := α1 + α2;

    β1 := dot (θ, rotate (ω1, π_2));
    β2 := dot (θ, rotate (ω2, π_2));
    β := β1 + β2;

    -- The Law of Malus.
    channel1 := (random_scalar < α ** 2);
    channel2 := (random_scalar < β ** 2);
  end split_beam;

----------------------------------------------------------------------

  --
  -- Data collection.
  --

  subtype pbs_direction is integer range 1 .. 2;

  type coincidence_pair is
    record
      L, R : pbs_direction;
    end record;

  package coincidence_pair_lists is
    new ada.containers.doubly_linked_lists
      (element_type => coincidence_pair);

  function simulate_one_event (θ_L, θ_R : pbs_setting)
  return coincidence_pair is
    channel_L1, channel_L2 : boolean;
    channel_R1, channel_R2 : boolean;

    procedure generate is
      φ : photon;
    begin
      φ := generate_photon;
      split_beam (θ_L, φ, channel_L1, channel_L2);
      split_beam (θ_R, φ, channel_R1, channel_R2);
    end generate;

    function valid
    return boolean is
    begin
      return (channel_L1 xor channel_L2)
                and (channel_R1 xor channel_R2);
    end valid;

  begin
    -- Generate photons until a valid coincidence pair is produced.
    generate;
    while not valid loop
      generate;
    end loop;
    return (L => (if channel_L1 then 1 else 2),
            R => (if channel_R1 then 1 else 2));
  end simulate_one_event;

  function simulate_many_events (θ_L, θ_R         : pbs_setting;
                                 number_of_events : count_type)
  return coincidence_pair_lists.list is
    use coincidence_pair_lists;
    events : list := empty_list;
  begin
    for i in 1 .. number_of_events loop
      append (events, simulate_one_event (θ_L, θ_R));
    end loop;
    return events;
  end simulate_many_events;

-- ----------------------------------------------------------------------

  --
  -- Analysis of coincidence pairs.
  --

  function count (events  : coincidence_pair_lists.list;
                  pattern : coincidence_pair)
  return count_type is
    use coincidence_pair_lists;
    n    : count_type := 0;
    curs : cursor := first (events);
  begin
    while has_element (curs) loop
      if element (curs) = pattern then
        n := n + 1;
      end if;
      curs := next (curs);
    end loop;
    return n;
  end count;

  function chsh_correlation (events : coincidence_pair_lists.list)
  return correlation_coefficient is
    n11 : constant count_type := count (events, (L => 1, R => 1));
    n12 : constant count_type := count (events, (L => 1, R => 2));
    n21 : constant count_type := count (events, (L => 2, R => 1));
    n22 : constant count_type := count (events, (L => 2, R => 2));
  begin
    return (scalar (n11 - n12 - n21 + n22)
              / scalar (n11 + n12 + n21 + n22));
  end chsh_correlation;

----------------------------------------------------------------------

  --
  -- A convenient combination of simulation and analysis.
  --

  function chsh_correlation (θ_L, θ_R         : pbs_setting;
                             number_of_events : count_type)
  return correlation_coefficient is
  begin
    return chsh_correlation (simulate_many_events
                               (θ_L, θ_R, number_of_events));
  end chsh_correlation;

----------------------------------------------------------------------

  --
  -- Bell test angles.
  --

  vector_00_0 : constant vector := e1;
  vector_22_5 : constant vector := rotate (e1, π_8);
  vector_45_0 : constant vector := rotate (e1, π_4);
  vector_67_5 : constant vector := rotate (e2, -π_8);

----------------------------------------------------------------------

begin
  declare
    E1, E2, E3, E4 : correlation_coefficient;
  begin
    E1 := chsh_correlation (vector_00_0, vector_22_5, 1e6);
    E2 := chsh_correlation (vector_00_0, vector_67_5, 1e6);
    E3 := chsh_correlation (vector_45_0, vector_22_5, 1e6);
    E4 := chsh_correlation (vector_45_0, vector_67_5, 1e6);
    put ("   E1: "); put (E1, 2, 5, 0); new_line;
    put ("   E2: "); put (E2, 2, 5, 0); new_line;
    put ("   E3: "); put (E3, 2, 5, 0); new_line;
    put ("   E4: "); put (E4, 2, 5, 0); new_line;
    put ("    S: "); put (E1 - E2 + E3 + E1, 2, 5, 0); new_line;
  end;
end eprb_coherent;

----------------------------------------------------------------------

